import React, { useState, useEffect } from 'react';
import { BarChart } from '@mui/x-charts/BarChart';

function TotalStoryPointBarChart() {
  const [chartData, setChartData] = useState(null);

  useEffect(() => {
    fetch('http://localhost:4000/api/available-sp')
      .then(response => {
        if (!response.ok) {
          throw new Error('Failed to fetch data');
        }
        return response.json(); // Parse JSON data
      })
      .then(data => {
        console.log(data); // Log the entire response
        // Process data and set it to state
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);


  console.log(chartData);

  return (
    <div>
      {chartData ? (
        <BarChart
          xAxis={[{ scaleType: 'band', data: chartData.xAxisData }]}
          series={[{ data: chartData.seriesData }]}
          width={500}
          height={300}
        />
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
}

export default TotalStoryPointBarChart;
